import React from 'react';
import { ProductName } from '../ProductItem/styled';
import {
    Container,
    ProductArea,
    ProdutcPhoto,
    ProductInfoArea,
    ProductDetails,
    ProductQuantityArea,
    ProductButtons
} from './styled';

export default ({data}) => {
    return(
        <Container>

            <ProductArea>

                <ProdutcPhoto src={data.image} />

                <ProductInfoArea>
                    <ProductDetails>
                        <ProductName>{data.name}</ProductName>
                    </ProductDetails>

                    <ProductQuantityArea>
                        {data.price}
                    </ProductQuantityArea>
                </ProductInfoArea>

            </ProductArea>

            <ProductButtons>

            </ProductButtons>

        </Container>
    );
}
